void convert()
{
    for (int i = 0; i < 100; i++)
    {
        for (int j = 0; j < 100; j++)
        {
            map2d_1[i][j] = arrmap1[100 * i + j];
        }
    }
}
movablemap::movablemap(const char* s, SDL_Renderer* r, int x1, int y1) {
    renderer = r;
    x = 0;
    y = 0;
    srcx = 0;
    srcy = 0;
    destx = 0;
    desty = 0;
    tex = TexHandler::GetTex(s, renderer);
    convert();
    
}
void movablemap::Update(string s) {
    cout << "srcx" << srcx << " srcy" << srcy << map2d_1[(srcy + 360) / 32][(srcx+640)/32] <<endl;


    if (s == "up" && map2d_1[(srcy + 360) / 32][(srcx + 640) / 32]==67) {
        if (srcy != 0) {
            srcy = srcy - 2;
        }
        
    }
    if (s == "down"&& map2d_1[(srcy + 360+4 +32) / 32][(srcx + 640) / 32] == 67) {

        if (srcy <= (100 - 25) * 32) {
            srcy = srcy +2;
        }
        cout << srcy << endl;

    }
    if (s == "right"&& map2d_1[(srcy + 360+32) / 32][(srcx + 640+32) / 32] == 67) {
        if (srcx <= (100 - 41) * 32) {
            srcx = srcx +2;
        }

    }
    if (s == "left"&&map2d_1[(srcy + 360+32) / 32][(srcx + 640-4) / 32] == 67) {
        if (srcx != 0) {
            srcx = srcx - 2;
        }
    }
    srcR.h = 720;
    srcR.w = 1280;
    srcR.x = srcx;
    srcR.y = srcy;

    destR.h = srcR.h;
    destR.w = srcR.w;
    destR.x = destx;
    destR.y = desty;
}
void movablemap::Render() {
    SDL_RenderCopy(renderer, tex, &srcR, &destR);
}
